script: |
  super -f text -I q530.spq | sort > q530.out

inputs:
  - name: q530.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 BETWEEN ( cor0.col2 ) AND - col2 * col2 * + col1;
  - name: tab2

outputs:
  - name: q530.out
    data: |
      7	31	27
      78	59	26
      79	17	38
